INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (27, '{"name": "World''s Famous Places", "category": "Geography", "imageName": "games/game_27.jpg", "type": "GEOFINDER", "questions": [{"question": "Where is the Eiffel Tower", "information": "The Effiel Tower is a wrought-iron lattice tower on the Champ de Mars in Paris, France. It is named after the engineer Gustave Eiffel, whose company designed and built the tower.", "area": 4.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Eiffel Tower", "visited_place": "Eiffel Tower", "longitude": 2.294664, "latitude": 48.858275, "altitude": 0.61, "heading": 0.0, "tilt": 0.0, "range": 1128.3791670955125, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where are the Petra buildings", "information": "Petra is a historical and archaeological city in southern Jordan. Petra lies on the slope of Jabal Al-Madbah in a basin among the mountains which form the eastern flank of the Arabah valley that runs from the Dead Sea to the Gulf of Aqaba. Petra is believed to have been settled as early as 9,000 BC, and it was possibly established in the 4th century BC as the capital city of the Nabataean Kingdom.", "area": 264.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Jordania", "visited_place": "Jordania", "longitude": 35.444201, "latitude": 30.328468, "altitude": 1.52, "heading": 0.0, "tilt": 0.0, "range": 9166.99568847508, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is Chichen Itza", "information": "Chichen Itza was a large pre-Columbian city built by the Maya people of the Terminal Classic period. The archaeological site is located in Tin\u00fam Municipality, Yucat\u00e1n State, Mexico.", "area": 29.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Yucat\u00e1n", "visited_place": "Yucat\u00e1n", "longitude": -88.567628, "latitude": 20.683893, "altitude": 0.73, "heading": 0.0, "tilt": 0.0, "range": 3038.2538898732496, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is el Cristo Redentor", "information": "Cristo Redentor is an Art Deco statue of Jesus Christ in Rio de Janeiro, Brazil, created by French sculptor Paul Landowski and built by Brazilian engineer Heitor da Silva Costa, in collaboration with French engineer Albert Caquot. Romanian sculptor Gheorghe Leonida fashioned the face. Constructed between 1922 and 1931, the statue is 30 metres (98 ft) high, excluding its 8-metre (26 ft) pedestal. The arms stretch 28 metres (92 ft) wide", "area": 10.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "R\u00edo de Janeiro", "visited_place": "R\u00edo de Janeiro", "longitude": -43.21067, "latitude": -22.951916, "altitude": 1.3, "heading": 0.0, "tilt": 0.0, "range": 1784.1241161527712, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is la Sagrada Fam\u00edlia", "information": "La Sagrada Fam\u00edlia is a large unfinished Roman Catholic church in Barcelona. Designed by Catalan architect Antoni Gaud\u00ed (1852\u20131926), his work on the building is part of a UNESCO World Heritage Site. In November 2010, Pope Benedict XVI consecrated the church and proclaimed it a minor basilica.", "area": 4.5, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Barcelona", "visited_place": "Barcelona", "longitude": 2.174144, "latitude": 41.403476, "altitude": 3.96, "heading": 0.0, "tilt": 0.0, "range": 1196.826841204298, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is the most famous coliseum", "information": "The coliseum is an oval amphitheatre in the centre of the city of Rome, Italy. Built of travertine, tuff, and brick-faced concrete, it is the largest amphitheatre ever built. The Colosseum is situated just east of the Roman Forum. Construction began under the emperor Vespasian in AD 72 and was completed in AD 80 under his successor and heir, Titus.", "area": 24.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Rome", "visited_place": "Rome", "longitude": 12.49223, "latitude": 41.890158, "altitude": 0.55, "heading": 0.0, "tilt": 0.0, "range": 2763.953195770684, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is Machu Picchu", "information": "Machu Picchu is the site of an ancient Inca city, high in the Andes of Peru. Located at 2,430m (8,000 ft), this UNESCO World Heritage site is often referred to as \"The Lost City of the Incas\". It''s one of the most familiar symbols of the Incan Empire and also one of the most famous and spectacular sets of ruins in the world. A visit to Peru would not be complete without seeing it, but this can be very expensive and crowded.", "area": 325.9, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Per\u00fa", "visited_place": "Per\u00fa", "longitude": -72.544905, "latitude": -13.163315, "altitude": 3.17, "heading": 0.0, "tilt": 0.0, "range": 10185.145649783186, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is the Taj Mahal", "information": "The Taj Mahal is an ivory-white marble mausoleum on the south bank of the Yamuna river in the Indian city of Agra. It was commissioned in 1632 by the Mughal emperor, Shah Jahan (reigned from 1628 to 1658), to house the tomb of his favourite wife, Mumtaz Mahal. It also houses the tomb of Shah Jahan, the builder.", "area": 17.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "India", "visited_place": "India", "longitude": 78.041498, "latitude": 27.174965, "altitude": 166.0, "heading": 0.0, "tilt": 0.0, "range": 2326.213245840639, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is the Great Wall", "information": "is the collective name of a series of fortification systems generally built across the historical northern borders of China to protect and consolidate territories of Chinese states and empires against various nomadic groups of the steppe and their polities. Several walls were being built from as early as the 7th century BC by ancient Chinese states; selective stretches were later joined together by Qin Shi Huang (220\u2013206 BC), the first Emperor of China. Little of the Qin wall remains.", "area": 21196.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "China", "visited_place": "China", "longitude": 116.570364, "latitude": 40.431801, "altitude": 1.03, "heading": 0.0, "tilt": 0.0, "range": 82139.49322677628, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
