INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (35, '{"name": "Mountains of Spain", "category": "Geography", "imageName": "games/game_35.jpg", "type": "GEOFINDER", "questions": [{"question": "Where is Montserrat", "information": "Montserrat is a multi-peaked mountain range near Barcelona, in Catalonia, Spain. It is part of the Catalan Pre-Coastal Range.", "area": 50.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Montserrat", "visited_place": "Montserrat", "longitude": 1.831788, "latitude": 41.594842, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3989.422804014327, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is the Mulhac\u00e9n", "information": "Mulhac\u00e9n is the highest mountain in continental Spain and in the Iberian Peninsula. It is part of the Sierra Nevada range in the Cordillera Penib\u00e9tica.", "area": 90.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Mulhac\u00e9n", "visited_place": "Mulhac\u00e9n", "longitude": -3.312716, "latitude": 37.052932, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 5352.372348458313, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is the Teide", "information": "Mount Teide is a volcano on Tenerife in the Canary Islands, Spain. Its summit (at 3,718 m (12,198 ft))[disputed \u2013 discuss] is the highest point in Spain and the highest point above sea level in the islands of the Atlantic.", "area": 190.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Teide", "visited_place": "Teide", "longitude": -16.642562, "latitude": 28.272249, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7776.816725043753, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is the Aneto", "information": "Aneto is the highest mountain in the Pyrenees and in Aragon, and Spain''s third-highest mountain, reaching a height of 3,404 metres (11,168 ft).", "area": 100.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Aneto", "visited_place": "Aneto", "longitude": 0.656432, "latitude": 42.630931, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 5641.895835477562, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is la Pica d''Estats", "information": "Pica d''Estats is a 3,143-metre-high (10,312 ft) mountain in the Montcalm Massif, Pyrenees. Is on the Spanish\u2013French border, and is the highest mountain in Catalonia.", "area": 70.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Pica d''Estats", "visited_place": "Pica d''Estats", "longitude": 1.397519, "latitude": 42.669049, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 4720.3487194131485, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is the Pedraforca", "information": "Pedraforca is a mountain in the Pre-Pyrenees, located in the comarca of Bergued\u00e0. The mountain''s rare form, along with the fact that it is not visibly connected to any other adjacent mountains or ridges, has made it one of the most famous and emblematic mountains in Catalonia.", "area": 40.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Pedraforca", "visited_place": "Pedraforca", "longitude": 1.706561, "latitude": 42.238761, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3568.2482323055424, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is Sierra Nevada", "information": "Sierra Nevada is a mountain range in the region of Andalucia, in the province of Granada and, a little further, M\u00e1laga and Almer\u00eda in Spain.", "area": 120.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Sierrra Nevada", "visited_place": "Sierrra Nevada", "longitude": -3.240617, "latitude": 37.06411, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6180.387232371033, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is Monte Perdido", "information": "Monte Perdido is the third highest mountain in the Pyrenees.", "area": 156.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Monte Perdido", "visited_place": "Monte Perdido", "longitude": 0.033159, "latitude": 42.675309, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7046.7256399459275, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where are the Picos de Europa", "information": "The Picos de Europa are a mountain range extending for about 20 km, forming part of the Cantabrian Mountains in northern Spain.", "area": 646.0, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "poi": {"id": 0, "name": "Picos de Europa", "visited_place": "Picos de Europa", "longitude": -4.823498, "latitude": 43.187056, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 14339.741506551949, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
