INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (66, '{"name": "TecnologicalAdvances", "category": "Technology", "imageName": "games/game_66.jpg", "type": "MILLIONAIRE", "questions": [{"question": "Who made the first network", "information": "The Advanced Research Projects Agency Network (ARPANET) was an early packet-switching network and the first network to implement the TCP/IP protocol suite.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "ARPANET", "answer2": "MIT", "answer3": "OTAN", "answer4": "APPLE", "poi": {"id": 0, "name": "NORTH_AMERICA", "visited_place": "NORTH_AMERICA", "longitude": -100.90688, "latitude": 40.478544, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 8300000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who created the first internalcombustion engine", "information": "An internal combustion engine (ICE) is a heat engine where the combustion of a fuel occurs with an oxidizer (usually air) in a combustion chamber that is an integral part of the working fluid flow circuit. In an internal combustion engine, the expansion of the high-temperature and high-pressure gases produced by combustion applies direct force to some component of the engine.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Steve Jobs", "answer2": "Einstein", "answer3": "Etienne Lenoir", "answer4": "Henry Ford", "poi": {"id": 0, "name": "Luxemburg", "visited_place": "Luxemburg", "longitude": 6.127289, "latitude": 49.737863, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 150000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "When it''s thought to be invented the first heel?", "information": "In its primitive form, a wheel is a circular block of a hard and durable material at whose center has been bored a circular hole through which is placed an axle bearing about which the wheel rotates when a moment is applied by gravity or torque to the wheel about its axis, thereby making together one of the six simple machines.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Paleolithic", "answer2": "Nolithic", "answer3": "Bronze Age", "answer4": "Middle Ages", "poi": {"id": 0, "name": "Tell Halaf", "visited_place": "Tell Halaf", "longitude": 40.040153, "latitude": 36.822788, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who is Steve Jobs", "information": "Steve Jobs was an American business magnate and investor. He was the chairman, chief executive officer (CEO), and co-founder of Apple Inc.; chairman and majority shareholder of Pixar; a member of The Walt Disney Company''s board of directors following its acquisition of Pixar; and the founder, chairman, and CEO of NeXT.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Inventor of Microssoft", "answer2": "Founder of Google", "answer3": "Inventor of Spotify", "answer4": "Co-founder of Apple", "poi": {"id": 0, "name": "San Francisco", "visited_place": "San Francisco", "longitude": -122.427272, "latitude": 37.74119, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 25000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who was the founder of the modern World Wide web (WWW)", "information": "The World Wide Web (WWW), commonly known as the Web, is an information system where documents and other web resources are identified by Uniform Resource Locators (URLs, which may be interlinked by hypertext, and are accessible over the Internet. The resources of the WWW may be accessed by users by a software application called a web browser.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Elon Musk", "answer2": "Bill Gates", "answer3": "Tim Berners", "answer4": "Steve Jobs", "poi": {"id": 0, "name": "London", "visited_place": "London", "longitude": -0.12839, "latitude": 51.505885, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 22000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "When was the first automobile built", "information": "The early history of the automobile can be divided into a number of eras, based on the prevalent means of propulsion. Later periods were defined by trends in exterior styling, size, and utility preferences. In 1769 the first steam-powered automobile capable of human transportation was built by Nicolas-Joseph Cugnot.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "1815", "answer2": "1769", "answer3": "1749", "answer4": "1652", "poi": {"id": 0, "name": "Brussels", "visited_place": "Brussels", "longitude": 4.359246, "latitude": 50.844977, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 18000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who was the inventor of the light bulb", "information": "Thomas Alva Edison was an American inventor and businessman, who has been described as America''s greatest inventor. He developed many devices in fields such as electric power generation, mass communication, sound recording, and motion pictures.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Thomas Edison", "answer2": "Albert Einstein", "answer3": "Marie Curie", "answer4": "Charles Darwin", "poi": {"id": 0, "name": "Ohio", "visited_place": "Ohio", "longitude": -82.601672, "latitude": 41.2935, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 450000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who were Larry Page and Sergey Brin", "information": "Google LLC is an American multinational technology company that specializes in Internet-related services and products, which include online advertising technologies, search engine, cloud computing, software, and hardware. It is considered one of the Big Four technology companies, alongside Amazon, Apple and Facebook.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Founders of Microssoft", "answer2": "Inventors of the computer", "answer3": "Inventors of the mouse", "answer4": "Found