INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (67, '{"name": "GeneralCulture3", "category": "General", "imageName": "games/game_67.jpg", "type": "MILLIONAIRE", "questions": [{"question": "From what language does Spanish come from", "information": "Spanish is a part of the Ibero-Romance group of languages, which evolved from several dialects of Vulgar Latin in Iberia after the collapse of the Western Roman Empire in the 5th century. The oldest Latin texts with traces of Spanish come from mid-northern Iberia in the 9th century, and the first systematic written use of the language happened in Toledo.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Greek", "answer2": "Basque", "answer3": "Latin", "answer4": "None of the anteriors", "poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -4.482268, "latitude": 40.33063, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1400000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is the sacred book of the Muslim religion", "information": "The Qur''an is the central religious text of Islam, which Muslims believe to be a revelation from Allah. It is widely regarded as the finest work in classical Arabic literature.The Quran is divided into chapters, which are subdivided into verses", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "The Bible", "answer2": "The Coran", "answer3": "The good muslim", "answer4": "The Tanaj", "poi": {"id": 0, "name": "Morocco", "visited_place": "Morocco", "longitude": -8.003049, "latitude": 31.63051, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1500000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who wrote Hamlet", "information": "William Shakespeare was an English poet, playwright and actor, widely regarded as the greatest writer in the English language and the world''s greatest dramatist. He is often called England''s national poet and the \"Bard of Avon\"", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "William Shakespeare", "answer2": "Charles Dickens", "answer3": "George Eliot", "answer4": "Miguel de Cervantes", "poi": {"id": 0, "name": "England", "visited_place": "England", "longitude": 0.064963, "latitude": 52.110567, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1050000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which is the coldest place on earth", "information": "Antarctica is Earth''s southernmost continent. It contains the geographic South Pole and is situated in the Antarctic region of the Southern Hemisphere, almost entirely south of the Antarctic Circle, and is surrounded by the Southern Ocean .About 98% of Antarctica is covered by ice that averages 1.9 km in thickness.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "North Pole", "answer2": "Australia", "answer3": "Antarctica", "answer4": "Greenland", "poi": {"id": 0, "name": "Antarctica", "visited_place": "Antarctica", "longitude": 19.79372, "latitude": -78.561768, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who discovered peniciline", "information": "Alexander Fleming was a Scottish biologist, physician, microbiologist, and pharmacologist. His best-known discoveries are the enzyme lysozyme in 1923 and the world''s first antibiotic substance benzylpenicillinin 1928, for which he shared the Nobel Prize in Physiology or Medicine in 1945 with Howard Florey and Ernst Boris Chain", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Charles Darwin", "answer2": "Leonardo da Vinci", "answer3": "Jeremy Wade", "answer4": "Alexander Fleming", "poi": {"id": 0, "name": "Scotland", "visited_place": "Scotland", "longitude": -3.511506, "latitude": 57.357065, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who wrote the Odyssey", "information": "The Odyssey  is one of two major ancient Greek epic poems attributed to Homer. It is, in part, a sequel to the Iliad, the other Homeric epic. The Odyssey is fundamental to the modern Western canon; it is the second-oldest extant work of Western literature, while the Iliad is the oldest. Scholars believe the Odyssey was composed near the end of the 8th century BC, somewhere in Ionia", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Plato", "answer2": "Homer", "answer3": "Hesiod", "answer4": "Aristotle", "poi": {"id": 0, "name": "Greece", "visited_place": "Greece", "longitude": 23.705622, "latitude": 37.961747, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1400000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "How many years did the 100 years war last?", "information": "The Hundred Years'' War was a series of conflicts waged from 1337 to 1453 by the House of Plantagenet, rulers of the Kingdom of England, against the French House of Valois, over the right to rule the Kingdom of France. Each side drew many allies into the war. It was one of the most notable conflicts of the Middle Ages, in which five generations of kings from two rival dynasties fought for the throne of the largest kingdom in Western Europe. The war marked both the height of chivalry and its subsequent decline, and the development of strong national identities in both countries.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "116.0", "answer2": "108.0", "answer3": "100.0", "answer4": "97.0", "poi": {"id": 0, "name": "France", "visited_place": "France", "longitude": 2.288826, "latitude": 48.659315, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1400000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who was the first person to land in the moon", "information": "Neil Armstrong was an American astronaut and aeronautical engineer who was the first person to walk on the Moon. He was also a naval aviator, test pilot, and university professor.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Laika", "answer2": "Mike Collins", "answer3": "Lance Armstrong", "answer4": "Neil Armstrong", "poi": {"id": 0, "name": "USA", "visited_place": "USA", "longitude": 2.288826, "latitude": 48.659315, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 5100000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (68, '{"name": "GeneralCulture2", "category": "General", "imageName": "games/game_67.jpg", "type": "MILLIONAIRE", "questions": [{"question": "From what state was Emperor Napoleon Bonaparte", "information": "Napoleon was a French statesman and military leader of Italian descent who rose to prominence during the French Revolution and led several successful campaigns during the French Revolutionary Wars. He was Emperor of the French as Napoleon I from 1804 until 1814 and again briefly in 1815", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "France", "answer2": "Italy", "answer3": "Germany", "answer4": "Spain", "poi": {"id": 0, "name": "France", "visited_place": "France", "longitude": 2.332639, "latitude": 48.853868, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1600000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Through what process do the plants get their food", "information": "Photosynthesis is a process used by plants and other organisms to convert light energy into chemical energy that can later be released to fuel the organisms'' activities. This chemical energy is stored in carbohydrate molecules, such as sugars, which are synthesized from carbon dioxide and water", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Cellular replication", "answer2": "Photosyntesis", "answer3": "Cellular respiration", "answer4": "Angiogenesis", "poi": {"id": 0, "name": "Switzerland", "visited_place": "Switzerland", "longitude": 8.54, "latitude": 47.378611, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 950000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is the name of the triangle that has all the sides equal", "information": "In geometry, an equilateral triangle is a triangle in which all three sides are equal. In the familiar Euclidean geometry, an equilateral triangle is also equiangular; that is, all three internal angles are also congruent to each other and are each 60\u00b0. It is also a regular polygon, so it is also referred to as a regular triangle.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Isosceles", "answer2": "Scalene", "answer3": "Equilateral", "answer4": "Equalical", "poi": {"id": 0, "name": "Greece", "visited_place": "Greece", "longitude": 23.722621, "latitude": 37.990764, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1400000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "In which country was the first atomic bomb used in combat", "information": "During the final stage of World War II, the United States detonated two nuclear weapons over the Japanese cities of Hiroshima and Nagasaki on August 6 and 9, 1945, respectively, with the consent of the United Kingdom, as required by the Quebec Agreement. The two bombings killed about 226,000 people, most of whom were civilians", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Japan", "answer2": "USA", "answer3": "Germany", "answer4": "URSS", "poi": {"id": 0, "name": "Japan", "visited_place": "Japan", "longitude": 132.464418, "latitude": 34.445725, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 2900000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "How many hearts do octopuses have", "information": "Octopuses have three hearts: one pumps blood around the body the other two pump blood to the gills. The reason for this impressive cardiac hardware probably comes down to the unusual composition of their blood.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "1.0", "answer2": "2.0", "answer3": "3.0", "answer4": "4.0", "poi": {"id": 0, "name": "Atlantic Ocean", "visited_place": "Atlantic Ocean", "longitude": -34.400521, "latitude": 31.220178, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 8000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "When did the first man arrive to the moon", "information": "The United States'' Apollo 11 was the first crewed mission to land on the Moon, on 20 July 1969.There have been six crewed U.S. landings (between 1969 and 1972) and numerous uncrewed landings, with no soft landings happening from 22 August 1976 until 14 December 2013.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "1965.0", "answer2": "1973.0", "answer3": "1945.0", "answer4": "1965.0", "poi": {"id": 0, "name": "USA", "visited_place": "USA", "longitude": -107.896153, "latitude": 39.814226, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 5200000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "How many states does USA have", "information": "In the United States, a state is a constituent political entity, of which there are currently 50. Bound together in a political union, each state holds governmental jurisdiction over a separate and defined geographic territory and shares its sovereignty with the federal government", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "45.0", "answer2": "50.0", "answer3": "55.0", "answer4": "1.0", "poi": {"id": 0, "name": "USA", "visited_place": "USA", "longitude": -107.896153, "latitude": 39.814226, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 5200000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is the longest river in Spain", "information": "The Tajo is the longest river in the Iberian Peninsula. It is 1,007 km  long, 716 km in Spain, 47 km along the border between Portugal and Spain and 275 km  in Portugal, where it empties into the Atlantic Ocean near Lisbon.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Ebro", "answer2": "Noguera Ribagor\u00e7ana", "answer3": "Tajo", "answer4": "Guadalquivir", "poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -5.273806, "latitude": 39.755962, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 14000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (69, '{"name": "Science1", "category": "Science", "imageName": "games/game_69.jpg", "type": "MILLIONAIRE", "questions": [{"question": "Who invented the light bulb", "information": "In 1879 Thomas Alva Edison showed for the first time an electric lamp with a bulb wich was switched on 48 hours", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Isaac Newton", "answer2": "Thomas Alva Edison", "answer3": "Archimedes", "answer4": "Albert Einstein", "poi": {"id": 0, "name": "Milan", "visited_place": "Milan", "longitude": -82.60467, "latitude": 41.297968, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 21000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who discovered this formula E = mc ^ 2", "information": "Energy is equal to mass times the speed of light squared. Albert Einstein''s famous formula demonstrates that mass and energy are different manifestations of the same thing, and that a very small amount of mass can be converted into a large amount of energy.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Albert Einstein", "answer2": "Charles Darwin", "answer3": "Galileo Galilei", "answer4": "Isaac Newton", "poi": {"id": 0, "name": "Ulm", "visited_place": "Ulm", "longitude": 9.987481, "latitude": 48.400986, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 20000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who invented the periodic table", "information": "Dmitry Mendeleyev realizes that if all 63 known elements are arranged in order of greater atomic weight, their properties are repeated according to certain periodic cycles. Formula of the periodic table of the elements and predicts the existence of elements that have not yet been discovered. Three of these elements are found during his life: gallium, scandium and germanium.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Charles Darwin", "answer2": "JJ Thomson", "answer3": "Dimitri Mendeleyev", "answer4": "Albert Einstein", "poi": {"id": 0, "name": "Tobolsk", "visited_place": "Tobolsk", "longitude": 68.260782, "latitude": 58.200405, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 30000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who discovered the electron", "information": "JJ Thomson discovers that the negative charged particles emitted by the cathode ray tubes are smaller than the atoms. He called these particles, now known as electrons, \"corpuscles\".", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "JJ Thomson", "answer2": "Niels Bohr", "answer3": "Dimitri Mendeleyev", "answer4": "Ernest Rutherford", "poi": {"id": 0, "name": "Manchester", "visited_place": "Manchester", "longitude": -2.242476, "latitude": 53.480803, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 20000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who discovered the cellular division", "information": "Walther Flemming carefully observes that animal cells are divided into stages, and calls the mitosis process. Eduard Strasburger independently identifies a similar process of cell division in plant cells.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Isaac Newton", "answer2": "Gregor Mendel", "answer3": "Ernest Rutherford", "answer4": "Walther Flemming", "poi": {"id": 0, "name": "Sachsenberg", "visited_place": "Sachsenberg", "longitude": 8.788138, "latitude": 51.125005, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What did Edmund Halley predict", "information": "Edmund Halley demonstrates that comets orbit around the Sun like planets and successfully predicts the return of Comet Halley (named in his honor). It is determined that the comets seen in 1531 and 1607 are the same object following a 76-year orbit. Halley''s prediction was demonstrated in 1758 when the comet returns. Unfortunately, Halley died in 1742, and could not appreciate the momentous event", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Asteroid Halley", "answer2": "Comet Halley", "answer3": "Weapon halley", "answer4": "Constellation Halley", "poi": {"id": 0, "name": "Londres", "visited_place": "Londres", "longitude": -0.12396, "latitude": 51.509563, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 22000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who invented the evolution theory", "information": "Charles Darwin publishes \"The Origin of Species Through Natural Selection,\" in which he challenges beliefs about the creation of life on Earth. Darwin had served as a naturalist who undertook a five-year scientific expedition along the Pacific coast of South America in early 1832, aboard the HMS Beagle, one of the most famous ships in history. The data collected during the expedition, especially the samples from the Galapagos Islands, was the inspiration for his theories on the evolution of natural selection mechanisms. His work has been at the center of the controversy since it was published.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Charles Darwin", "answer2": "Alexander Fleming", "answer3": "Gregor Mendel", "answer4": "Albert Einstein", "poi": {"id": 0, "name": "Shrewsbury", "visited_place": "Shrewsbury", "longitude": -2.755352, "latitude": 52.7073, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 5000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What did Nicolaus Copernicus discover", "information": "Nicolaus Copernicus places the sun, not the Earth, at the center of the solar system.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "The Sun is moving around the Earth", "answer2": "Both are moving", "answer3": "Earth is moving around the Sun", "answer4": "Neither the sun moves nor the Earth", "poi": {"id": 0, "name": "Torun", "visited_place": "Torun", "longitude": 18.59937, "latitude": 53.012954, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 22000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (70, '{"name": "Energy", "category": "Production", "imageName": "games/game_70.jpg", "type": "MILLIONAIRE", "questions": [{"question": "Wich one of these energies doesn''t exist", "information": "Parabolic Energy doesn''t exist, potential energy is the energy held by an object because of its position relative to other objects, kinetic energy is the energy that an object possesses due to its motion and thermal energy is the internal energy of a system; heat or sensible heat", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Kinetic Energy", "answer2": "Thermal Energy", "answer3": "Parabolic Energy", "answer4": "Potential Energy", "poi": {"id": 0, "name": "CHINA(eolic park)", "visited_place": "CHINA(eolic park)", "longitude": 96.9, "latitude": 40.2, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 35000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Wich one of these is a renewable energy", "information": "Renewable energy is energy that is collected from renewable resources, which are naturally replenished on a human timescale, such as sunlight, wind, rain, tides, waves, and geothermal heat", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Nuclear Energy", "answer2": "Marine Energy", "answer3": "Natural Gas Energy", "answer4": "Coal Energy", "poi": {"id": 0, "name": "FRANCE(marine energy power plant)", "visited_place": "FRANCE(marine energy power plant)", "longitude": -2.023333, "latitude": 48.618056, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 5000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is the optimal speed for a wind turbine to spin", "information": "The wind turbines begin to work when the wind reaches a speed of 3 to 4 meters per second, and reaches the maximum production of electricity with a wind of about 13 to 14 meters per second. If the wind is very strong, for example 25 meters per second as the average speed for 10 minutes, the wind turbines stop for safety reasons.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "100m/s", "answer2": "300km/h", "answer3": "29m/s", "answer4": "13,5 m/s", "poi": {"id": 0, "name": "CHINA(eolic park)", "visited_place": "CHINA(eolic park)", "longitude": 96.9, "latitude": 40.2, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 35000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Wich is the highest temperaturethat a  solar furnace can reach", "information": "A solar furnace is a structure that uses concentrated solar power to produce high temperatures, usually for industry. Parabolic mirrors or heliostats concentrate light (Insolation) onto a focal point. The temperature at the focal point may reach 3,500 \u00b0C (6,330 \u00b0F), and this heat can be used to generate electricity, melt steel, make hydrogen fuel or nanomaterials.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "3500\u00baC", "answer2": "283K", "answer3": "900\u00baC", "answer4": "1200\u00baF", "poi": {"id": 0, "name": "FRANCE(world''s biggest solar furnace)", "visited_place": "FRANCE(world''s biggest solar furnace)", "longitude": 2.0292, "latitude": 42.4939, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 2000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is the most common fuel in nuclear power stations", "information": "Nuclear fuel is material used in nuclear power stations to produce heat to power turbines. Heat is created when nuclear fuel undergoes nuclear fission.The three most relevant fissile isotopes are Uranium-233, Uranium-235 and Plutonium-239", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Hydrogen (H)", "answer2": "Iron (Fe)", "answer3": "Uranium (U)", "answer4": "Rhodium (Rh)", "poi": {"id": 0, "name": "JAPAN(world''s biggest nuclear plant)", "visited_place": "JAPAN(world''s biggest nuclear plant)", "longitude": 138.601667, "latitude": 37.428333, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 4000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which element is used to build photovoltaic panels", "information": "The basic component of a solar cell is pure silicon, which has been used as an electrical component for decades. Currently, over 90% of the current solar cell market is based on silicon.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Carbon (C)", "answer2": "Sodium (Na)", "answer3": "Iron (Fe)", "answer4": "Silicon (Si)", "poi": {"id": 0, "name": "SPAIN(solar plant)", "visited_place": "SPAIN(solar plant)", "longitude": -6.277054, "latitude": 37.417863, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 9000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What kind of nuclear energy do we use", "information": "Nuclear fission is a nuclear reaction or a radioactive decay process in which the nucleus of an atom splits into smaller, lighter nuclei. The fission process often produces free neutrons and gamma photons, and releases a very large amount of energy even by the energetic standards of radioactive decay.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Nuclear Fusion", "answer2": "Nuclear Fission", "answer3": "Nuclear Heating", "answer4": "Nuclear Engine", "poi": {"id": 0, "name": "JAPAN(world''s biggest nuclear plant)", "visited_place": "JAPAN(world''s biggest nuclear plant)", "longitude": 138.601667, "latitude": 37.428333, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where does most of the energy that we consum come from nowadays", "information": "In 2014, the share of world energy consumption for electricity generation by source was coal at 40.8%,followed by natural gas at 21.6%", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Coal Combustion", "answer2": "Nuclear Fision", "answer3": "Solar Radiation", "answer4": "Wind Power", "poi": {"id": 0, "name": "POLAND(world biggest lignite-fired power station )", "visited_place": "POLAND(world biggest lignite-fired power station )", "longitude": 19.330556, "latitude": 51.266389, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 8000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (71, '{"name": "Literatura", "category": "General", "imageName": "games/game_71.jpg", "type": "MILLIONAIRE", "questions": [{"question": "When did Romanticism arise?", "information": "Romanticism is a cultural movement that originates in Germany and the United Kingdom in the late eighteenth century as a revolutionary reaction against the Enlightenment and Neoclassicism, giving priority to feelings.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Second half of the 18th century", "answer2": "Second half of the 19th century", "answer3": "First half of the 18th century", "answer4": "First half of the 19th century", "poi": {"id": 0, "name": "Alemanya", "visited_place": "Alemanya", "longitude": 10.451683, "latitude": 51.218671, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1150000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "When was romanticism developed?", "information": "It was developed in the first half of the 19th century, extending from England and Germany to other European countries.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Second half of the 19th century", "answer2": "Second half of the 18th century", "answer3": "First half of the 19th century", "answer4": "First half of the 18th century", "poi": {"id": 0, "name": "Alemanya", "visited_place": "Alemanya", "longitude": 10.451683, "latitude": 51.218671, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1150000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who wrote ''The Iliad''?", "information": "The Iliad  is an ancient Greek epic poem in dactylic hexameter, traditionally attributed to Homer. Homer is born in Turquia.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Her\u00f3doto", "answer2": "Marco Tulio Cicer\u00f3n", "answer3": "Homero", "answer4": "S\u00e9neca", "poi": {"id": 0, "name": "Turqu\u00eda", "visited_place": "Turqu\u00eda", "longitude": 35.310489, "latitude": 38.974941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1600000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who is the author of ''The art of war''?", "information": "The Art of War is an ancient Chinese military treatise dating from the Late Spring and Autumn Period", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Confucio", "answer2": "Sun Tzu", "answer3": "D\u00e0o D\u00e9 Jing", "answer4": "Sh\u00ef J\u00efng", "poi": {"id": 0, "name": "Xina", "visited_place": "Xina", "longitude": 104.171419, "latitude": 35.742712, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 5000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where and when did the literary Modernism begin?", "information": "Literary modernism, or modernist literature, has its origins in the late 19th and early 20th centuries, mainly in Europe and North America, and is characterized by a very self-conscious break with traditional ways of writing, in both poetry and prose fiction.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "In Germany, 1880", "answer2": "In Spain, 1880", "answer3": "In France, 1880", "answer4": "In Hispanoamerica, 1890", "poi": {"id": 0, "name": "Madrid", "visited_place": "Madrid", "longitude": -3.691919, "latitude": 40.42318, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 45000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who was the creator of Modernism?", "information": "F\u00e9lix Rub\u00e9n Garc\u00eda Sarmiento, known as Rub\u00e9n Dar\u00edo, was a Nicaraguan poet, journalist and diplomat, the greatest representative of literary modernism in the Spanish language. It is, perhaps, the poet who has had greater and more lasting influence on the poetry of the twentieth century in the Hispanic field.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Ruben Dario", "answer2": "Antonio Machado", "answer3": "Juan Ram\u00f3n Jimenez", "answer4": "Manuel Machado", "poi": {"id": 0, "name": "Cd Dar\u00edo", "visited_place": "Cd Dar\u00edo", "longitude": -86.12178, "latitude": 12.734112, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Indicate which of these works Antonio Machado did not write?", "information": "Antonio Machado Ruiz (Seville, July 26, 1875-Collioure, February 22, 1939) was a Spanish poet, the youngest representative of the generation of 98. His early work, modernist (like his brother Manuel) , it evolved towards a symbolist intimacy with romantic features, which matured into a poetry of human commitment, on the one hand, and almost Taoist contemplation of existence, on the other; a synthesis that in the voice of Machado echoes the most ancestral popular wisdom. Said in the words of Gerardo Diego, \u00abhe spoke in verse and lived in poetry\u00bb.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Diary of a newly married poet", "answer2": "Proverbs and songs", "answer3": "Solitudes, galleries and other poems", "answer4": "Campos de Castilla", "poi": {"id": 0, "name": "Sevilla", "visited_place": "Sevilla", "longitude": -5.983723, "latitude": 37.386913, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 23000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where and when was Antonio Machado born?", "information": "Antonio Machado Ruiz (Seville, July 26, 1875-Collioure, February 22, 1939) was a Spanish poet, the youngest representative of the generation of 98. His early work, modernist (like his brother Manuel) , it evolved towards a symbolist intimacy with romantic features, which matured into a poetry of human commitment, on the one hand, and almost Taoist contemplation of existence, on the other; a synthesis that in the voice of Machado echoes the most ancestral popular wisdom. Said in the words of Gerardo Diego, \u00abhe spoke in verse and lived in poetry\u00bb.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "In Las Palmas in 1890", "answer2": "In Madrid in 1875", "answer3": "In Granada in 1890", "answer4": "In Seville in 1875", "poi": {"id": 0, "name": "Sevilla", "visited_place": "Sevilla", "longitude": -5.983723, "latitude": 37.386913, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 23000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (72, '{"name": "Engines", "category": "Technology", "imageName": "games/game_72.png", "type": "MILLIONAIRE", "questions": [{"question": "Who invented the two-stroke engine?", "information": "A two-stroke (or two-cycle) engine is a type of internal combustion engine which completes a power cycle with two strokes (up and down movements) of the piston during only one crankshaft revolution.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Dugal Clerk", "answer2": "Thomas Edison", "answer3": "Albert Einstein", "answer4": "Nikola Tesla", "poi": {"id": 0, "name": "Glasgow", "visited_place": "Glasgow", "longitude": -4.250527, "latitude": 55.862873, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 20000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who invented the four-stroke engine?", "information": "A four-stroke (also four-cycle) engine is an internal combustion (IC) engine in which the piston completes four separate strokes while turning the crankshaft. A stroke refers to the full travel of the piston along the cylinder, in either direction.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Jean Joseph Etienne Lenoir", "answer2": "Nicolaus Otto", "answer3": "Nikola Tesla", "answer4": "Dugal Clerk", "poi": {"id": 0, "name": "Germany", "visited_place": "Germany", "longitude": 8.63992, "latitude": 50.754361, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is a horsepower", "information": "Horsepower (hp) is a unit of measurement of power, or the rate at which work is done.Two common definitions being used today are the mechanical horsepower (or imperial horsepower), which is about 745.7 watts, and the metric horsepower, which is approximately 735.5 watts.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "A mesurament of torque", "answer2": "A mesurament of Power", "answer3": "a mesurament of energy", "answer4": "A mesurament of temperature", "poi": {"id": 0, "name": "Great Britain", "visited_place": "Great Britain", "longitude": -2.590246, "latitude": 54.695897, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1050000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is measured by N\u00b7m", "information": "The newton metre (also newton-metre, symbol N m or N\u22c5m) is a unit of torque (also called moment) in the SI system.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Power", "answer2": "Energy", "answer3": "Temperature", "answer4": "Torque", "poi": {"id": 0, "name": "Germany", "visited_place": "Germany", "longitude": 8.63992, "latitude": 50.754361, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What developed the mass production?", "information": "Mass production, also known as flow production or continuous production, is the production of large amounts of standardized products, including and especially on assembly lines. Together with job production and batch production, it is one of the three main production methods.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Thomas Edison", "answer2": "Henry Ford", "answer3": "Nikola Tesla", "answer4": "Albert Einstein", "poi": {"id": 0, "name": "Greenfield", "visited_place": "Greenfield", "longitude": -75.586593, "latitude": 41.614375, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 80000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is the most common shape on a piston?", "information": "A piston is a component of reciprocating engines, reciprocating pumps, gas compressors and pneumatic cylinders, among other similar mechanisms. It is the moving component that is contained by a cylinder and is made gas-tight by piston rings.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Hexagonal", "answer2": "Round", "answer3": "Triangular", "answer4": "Square", "poi": {"id": 0, "name": "Great Britain", "visited_place": "Great Britain", "longitude": -2.590246, "latitude": 54.695897, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1050000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which of the following parts isn''t a component of an engine", "information": "The rim is the \"outer edge of a wheel, holding the tire\". It makes up the outer circular design of the wheel on which the inside edge of the tire is mounted on vehicles such as automobiles.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Rim", "answer2": "Piston", "answer3": "Crankshaft", "answer4": "Camshaft", "poi": {"id": 0, "name": "Germany", "visited_place": "Germany", "longitude": 8.63992, "latitude": 50.754361, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which type of engine us often used in cars?", "information": "An engine or motor is a machine designed to convert one form of energy into mechanical energy. Heat engines, like the internal combustion engine, burn a fuel to create heat which is then used to do work.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Nuclear engine", "answer2": "Four-stroke engine", "answer3": "Two-stroke engine", "answer4": "Hydraulic engine", "poi": {"id": 0, "name": "US", "visited_place": "US", "longitude": -101.418683, "latitude": 39.745794, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 4000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which is the most efficient way to transmit power to the wheels?", "information": "Is a transmission movement which distributes the power of the car to the four wheels in a balanced way", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "ti