INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (74, '{"name": "RiversOfSpain ", "category": "Geography", "imageName": "games/game_74.jpg", "type": "MILLIONAIRE", "questions": [{"question": "Where does Ebro born", "information": "The Ebro is a river of the northeast of the Iberian Peninsula, the second longest of this, after the Tagus and also the second as far as its flow, after the Duero, respectively. It occurs entirely in Spain. Among the rivers that flow into the Mediterranean Sea is only exceeded in length by the Nile.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -3.938318, "latitude": 40.326307, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Madrid", "answer2": "Murcia", "answer3": "Galicia", "answer4": "Lleida", "poi": {"id": 0, "name": "Galicia", "visited_place": "Galicia", "longitude": -7.942642, "latitude": 42.902795, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 350000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where does Tajo born", "information": "The Tajo River is the longest river of the Iberian Peninsula, which it crosses in its central part, following an east-west course, with a slight inclination towards the southwest, which is accentuated when it arrives in Portugal. It is born in the Universal Mountains, in the mountain range of Albarrac\u00edn, on the western branch of the Iberian system and, after traveling 1007 km, it reaches the Atlantic Ocean in the city of Lisboa", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -3.938318, "latitude": 40.326307, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Murcia", "answer2": "Cantabria", "answer3": "Valencia", "answer4": "Catalonia", "poi": {"id": 0, "name": "Cantabria", "visited_place": "Cantabria", "longitude": -4.068737, "latitude": 43.219647, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 200000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where does Duero born", "information": "The Duero is one of the major rivers of the Iberian Peninsula, flowing from its source near Duruelo de la Sierra in Soria Province across northern-central Spain and Portugal to its outlet at Porto.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -3.938318, "latitude": 40.326307, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Murcia", "answer2": "Cantabria", "answer3": "Galicia", "answer4": "Castilla Leon", "poi": {"id": 0, "name": "Castilla Leon", "visited_place": "Castilla Leon", "longitude": -4.738535, "latitude": 41.692292, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 530000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where does Mi\u00f1o born", "information": "The Mi\u00f1o is a river located in the northwest of the Iberian Peninsula, which runs entirely by the autonomous community of Galicia, although in its final stretch forms the border between Spain and Portugal before emptying into the Atlantic Ocean. It is the longest river in Galicia, and the largest when it receives the river Sil, its main tributary. It has a length of 315 km and drains a wide basin of 12 486 km\u00b2", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -3.938318, "latitude": 40.326307, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Galicia", "answer2": "Murcia", "answer3": "Valencia", "answer4": "Cantabria", "poi": {"id": 0, "name": "Galicia", "visited_place": "Galicia", "longitude": -7.942642, "latitude": 42.902795, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 350000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where does Jucar born", "information": "The Jucar is a river of the Iberian Peninsula, which runs through the east of Spain. It has a length of 498 km, crosses the provinces of Cuenca, Albacete and Valencia, and empties into the Mediterranean Sea.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -3.938318, "latitude": 40.326307, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Castilla Leon", "answer2": "Extremadura", "answer3": "Castilla la Mancha", "answer4": "Andalusia", "poi": {"id": 0, "name": "Castilla la Mancha", "visited_place": "Castilla la Mancha", "longitude": -3.17243, "latitude": 39.284918, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 400000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where does Guadiana born", "information": "It is the fourth longest river in the Iberian Peninsula with 818 km and the fourth largest river, passing through two countries, Spain and Portugal. It crosses the South sub-plateau in east-west direction. At the height of the Spanish city of Badajoz, it takes a southerly course, which maintains its mouth in the Atlantic Ocean, where it pours an average flow of 78.8 m\u00b3 / s. In its low course, it forms a border between Spain and Portugal along numerous stretches.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -3.938318, "latitude": 40.326307, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Murcia", "answer2": "Castilla la Mancha", "answer3": "Andalusia", "answer4": "Galicia", "poi": {"id": 0, "name": "Castilla la Mancha", "visited_place": "Castilla la Mancha", "longitude": -3.17243, "latitude": 39.284918, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 400000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where does Segura born", "information": "The river begins at Santiago Pontones (province of Ja\u00e9n), passes Calasparra, Cieza, Blanca, Murcia, Murcia, Beniaj\u00e1n, Orihuela, Rojales and ends in the Mediterranean Sea near Guardamar del Segura in the province of Alicante. Some of its tributaries are the Mundo (which starts near Ri\u00f3par), the Alh\u00e1rabe (which starts in Moratalla), the Mula and the Guadalent\u00edn.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -3.938318, "latitude": 40.326307, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Andalucia", "answer2": "Catalonia", "answer3": "Murcia", "answer4": "Extremadura", "poi": {"id": 0, "name": "Andalucia", "visited_place": "Andalucia", "longitude": -4.474996, "latitude": 37.376517, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 500000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where does Guadalquivir born", "information": "The fifth longest river in the Iberian Peninsula and the second longest river with its entire length in Spain. The Guadalquivir river is the only great navigable river in Spain. Currently it is navigable from the Gulf of C\u00e1diz to Seville, but in Roman times it was navigable to C\u00f3rdoba.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -3.938318, "latitude": 40.326307, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Galicia", "answer2": "Madrid", "answer3": "Castilla Leon", "answer4": "Andalucia", "poi": {"id": 0, "name": "Andalucia", "visited_place": "Andalucia", "longitude": -4.474996, "latitude": 37.376517, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 500000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (75, '{"name": "History EEUU", "category": "History", "imageName": "games/game_75.jpg", "type": "MILLIONAIRE", "questions": [{"question": "When was the USA first colonized", "information": "The colonial history of the United States covers the history of European colonization of America from the early 16th century until the incorporation of the colonies into the United States of America until the late 16th century", "correct_answer": 3, "initial_poi": {"id": 0, "name": "North America", "visited_place": "North America", "longitude": -97.658032, "latitude": 38.936881, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "1492", "answer2": "Late 16th century", "answer3": "Early 16th century", "answer4": "Mid 13th century", "poi": {"id": 0, "name": "San Antonio", "visited_place": "San Antonio", "longitude": -98.486247, "latitude": 29.418032, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 55000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Against who and when did the Americans revolt", "information": "The American Revolution was a colonial revolt which occurred between 1765 and 1783. The American Patriots in the Thirteen Colonies defeated the British in the American Revolutionary War (1775\u20131783) with the assistance of France, winning independence from Great Britain and establishing the United States of America.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "UK, 1999", "answer2": "UK, 1765", "answer3": "France, 1765", "answer4": "Spain,1492", "poi": {"id": 0, "name": "London", "visited_place": "London", "longitude": -0.126018, "latitude": 51.500757, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 65000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What was the trigger for the revolution", "information": "The colonists were not happy with the new taxes. They said they should not have to pay British taxes because they had no representatives in the British Parliament. Their motto became \"No Taxation Without Representation.\"", "correct_answer": 3, "initial_poi": {"id": 0, "name": "North America", "visited_place": "North America", "longitude": -97.658032, "latitude": 38.936881, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "The increase in taxes by Spain", "answer2": "The high price of coffe", "answer3": "That they didn''t have representation in the Parliament", "answer4": "They didn''t like the UK laws", "poi": {"id": 0, "name": "Boston", "visited_place": "Boston", "longitude": -71.048432, "latitude": 42.360155, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 45000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who was the first president of the USA", "information": "After the Constitution was ratified, Washington unanimously won the presidential election and took the oath of office in New York on April 30, 1789. At the time he was elected President, there were no established political parties in the United States", "correct_answer": 4, "initial_poi": {"id": 0, "name": "North America", "visited_place": "North America", "longitude": -97.658032, "latitude": 38.936881, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Benjamin Franklin", "answer2": "Abraham Lincoln", "answer3": "Barack Obama", "answer4": "George Washington", "poi": {"id": 0, "name": "Washington D.C", "visited_place": "Washington D.C", "longitude": -77.049095, "latitude": 38.889366, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 25000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who fought in the American Civil War", "information": "The American Civil War (also known by other names) was a civil war fought in the United States from 1861 to 1865, between the North (Union) and the South (Confederacy).the Civil War began primarily as a result of the long-standing controversy over the enslavement of black people.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "North America", "visited_place": "North America", "longitude": -97.658032, "latitude": 38.936881, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "North(union) vs South(Confederacy)", "answer2": "East(Democrats) vs West(Confederats)", "answer3": "Americans vs Natives", "answer4": "Libertarians vs Democrats", "poi": {"id": 0, "name": "Chicago", "visited_place": "Chicago", "longitude": -87.623074, "latitude": 41.880854, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 85000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who won the civil war", "information": "Confederate forces across the South surrendered as news of Lee''s surrender reached them. On April 26, 1865, General Joseph E. Johnstonsurrendered nearly 90,000 men of the Army of Tennessee to Major General William Tecumseh Sherman at the Bennett Place near present-day Durham, North Carolina. It proved to be the largest surrender of Confederate forces, effectively bringing the war to an end.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "North America", "visited_place": "North America", "longitude": -97.658032, "latitude": 38.936881, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "The East", "answer2": "The Natives", "answer3": "The Union", "answer4": "The Confederats", "poi": {"id": 0, "name": "Salt Lake city", "visited_place": "Salt Lake city", "longitude": -111.8905, "latitude": 40.769467, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 60000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "When did the USA declare war to Germany", "information": "The United States declared war on Germany on April 6, 1917, more than two and a half years after World War I started. During the war the U.S. mobilized over 4 million military personnel and suffered 110,000 deaths, including around 45,000 who died due to the 1918 Spanish influenza outbreak", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "on July 4, 1918", "answer2": "on April 6, 1917", "answer3": "October 21, 1945", "answer4": "February 28, 1920", "poi": {"id": 0, "name": "Germany", "visited_place": "Germany", "longitude": 13.390448, "latitude": 52.535289, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1160000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (76, '{"name": "GeneralCulture", "category": "General", "imageName": "games/game_67.jpg", "type": "MILLIONAIRE", "questions": [{"question": "What type of animal is a whale", "information": "Whales are a widely distributed and diverse group of fully aquatic placental marine mammals. They are an informal grouping within the infraorder Cetacea, usually excluding dolphins and porpoises.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "A fish", "answer2": "A feline", "answer3": "A mammal", "answer4": "An insect", "poi": {"id": 0, "name": "Atlantic Ocean", "visited_place": "Atlantic Ocean", "longitude": -34.400521, "latitude": 31.220178, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 8000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who wrote Don Quijote de la Mancha", "information": "Don Quijote de la Mancha was published in two parts, in 1605 and 1615, Don Quixote is the most influential work of literature from the Spanish Golden Age and the entire Spanish literary canon. As a founding work of modern Western literature, it regularly appears high on lists of the greatest works of fiction ever published", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Gustavo Adolfo B\u00e9cquer", "answer2": "Miguel de Cervantes", "answer3": "Lope de Vega", "answer4": "It was anonymous", "poi": {"id": 0, "name": "Spain", "visited_place": "Spain", "longitude": -3.986787, "latitude": 39.797107, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1400000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who painted The Last Dinner", "information": "Leonardo, was an Italian polymath of the Renaissance whose areas of interest included invention, drawing, painting, sculpting, architecture, science, music, mathematics, engineering, literature, anatomy, geology, astronomy, botany, writing, history, and cartography.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Pablo Picasso", "answer2": "Antonio Gaud\u00ed", "answer3": "Leonardo Da Vinci", "answer4": "Michelangelo Buonarroti", "poi": {"id": 0, "name": "Italy", "visited_place": "Italy", "longitude": 11.255836, "latitude": 43.773445, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1300000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "How is the science that studies maps called", "information": "Cartography is the study and practice of making maps. Combining science, aesthetics, and technique, cartography builds on the premise that reality can be modeled in ways that communicate spatial information effectively.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Geography", "answer2": "Geology", "answer3": "Physics", "answer4": "Cartography", "poi": {"id": 0, "name": "France", "visited_place": "France", "longitude": 5.784326, "latitude": 46.087255, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1250000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "When did the second world war start", "information": "The Second World War, was a global war that lasted from 1939 to 1945. The vast majority of the world''s countries, including all the great powers, eventually formed two opposing military alliances: the Allies and the Axis. A state of total war emerged, directly involving more than 100 million people from over 30 countries.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "1939", "answer2": "1945", "answer3": "1936", "answer4": "1918", "poi": {"id": 0, "name": "Germany", "visited_place": "Germany", "longitude": 13.36291, "latitude": 52.493973, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1200000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Where is insulin produced", "information": "Insulin  is a peptide hormone produced by beta cells of the pancreatic islets; it is considered to be the main anabolic hormone of the body. It regulates the metabolism of carbohydrates, fats and protein by promoting the absorption of carbohydrates, especially glucose from the blood into liver, fat and skeletal muscle cells.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "In the liver", "answer2": "In the pancreas", "answer3": "In the brain", "answer4": "In the heart", "poi": {"id": 0, "name": "Singapore", "visited_place": "Singapore", "longitude": 103.846301, "latitude": 1.307818, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 60000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What was the first metal used by men", "information": "Copper is a soft, malleable, and ductile metal with very high thermal and electrical conductivity. A freshly exposed surface of pure copper has a pinkish-orange color. Copper is used as a conductor of heat and electricity, as a building material, and as a constituent of various metal alloys", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Iron", "answer2": "Aluminium", "answer3": "Copper", "answer4": "Gold", "poi": {"id": 0, "name": "CHILE(world''s biggest copper mine)", "visited_place": "CHILE(world''s biggest copper mine)", "longitude": -68.901944, "latitude": -22.290556, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 22000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Wich of these particles is smaller", "information": "Electrons belong to the first generation of the lepton particle family, and are generally thought to be elementary particles because they have no known components or substructure. The electron has a mass that is approximately 1/1836 that of the proton", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Electron", "answer2": "Molecule", "answer3": "Atom", "answer4": "Cell", "poi": {"id": 0, "name": "France", "visited_place": "France", "longitude": 5.784326, "latitude": 46.087255, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1250000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (77, '{"name": "Literatura Catalana", "category": "General", "imageName": "games/game_77.jpg", "type": "MILLIONAIRE", "questions": [{"question": "Who proposed the dialectal division of Catalan into two major blogs?", "information": "Manuel Mil\u00e0 i Fontanals is considered one of the promoters of the Renaixen\u00e7a, thanks to his efforts in the restoration of Floral Games, in the field of spelling.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Carles Aribau", "answer2": "Jacint Verdaguer", "answer3": "Manuel Mil\u00e0 i Fontanals", "answer4": "Adri\u00e0 Gual", "poi": {"id": 0, "name": "Villafranca del Panad\u00e9s", "visited_place": "Villafranca del Panad\u00e9s", "longitude": 1.698295, "latitude": 41.346013, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 45000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which of these are missing dialects?", "information": "The Association of Neighbors of Fort-de-l''Eau celebrates an annual meeting of Algerians descending from Minorcan in the Proven\u00e7al population The Island of Surge.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "the Minorcan of Fort-de-l''Eau", "answer2": "Alghero", "answer3": "Balearic", "answer4": "Central", "poi": {"id": 0, "name": "Alg\u00e8ria", "visited_place": "Alg\u00e8ria", "longitude": 1.764673, "latitude": 28.203959, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 2500000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which of these dialects do not belong to Eastern dialects?", "information": "Valencian, also called southern Catalan, is a dialectal variety of Catalan spoken in the Valencian Country and in the region of Carxe, in the Region of Murcia, as well as in the south of the Terres de l''Ebre and the Poniente Strip.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Alghero", "answer2": "Valencia", "answer3": "Central", "answer4": "Balearic", "poi": {"id": 0, "name": "Valencia", "visited_place": "Valencia", "longitude": -0.371018, "latitude": 39.464931, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 19000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "When did the Homilies of Organy\u00e0 appeared?", "information": "The Homilies of Organy\u00e0 is a fragment of a sermon for the preaching of the Gospel and discovered in the Organy\u00e0 rectory in 1904. It represents one of the oldest literary documents written in the Catalan language. They are the translation into Catalan of some sermons written in Occitan and show the use of the Catalan language in the preaching addressed to the people. The original manuscript is located in the Biblioteca de Catalunya, while in Organy\u00e0 there is a reproduction.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "at the end of the 13th century and beginning of the 14th century.", "answer2": "at the end of the 11th century and beginning of the 12th century.", "answer3": "at the end of the 14th century and beginning of the 15th century.", "answer4": "at the end of the 12th century and beginning of the 13th century.", "poi": {"id": 0, "name": "Organy\u00e0", "visited_place": "Organy\u00e0", "longitude": 1.327897, "latitude": 42.211953, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 2000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which of these is one of the 4 great Catalan chronicles", "information": "The four great Chronicles is the name with which four works written in Catalan at the end of the thirteenth century and during the XIV are known. These are the chronicles of James I, Bernat Desclot, Ramon Muntaner and Pere el Cerimoni\u00f3s. Its purpose was to record certain facts that wanted to have didactic value. The four great Chronicles form the best historiographic set of medieval Europe.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "The Chronicle of Bernat Desclot", "answer2": "The Chronicle of James I", "answer3": "The Chronicle of Ramon Muntaner.", "answer4": "They all are", "poi": {"id": 0, "name": "Valencia", "visited_place": "Valencia", "longitude": -0.371018, "latitude": 39.464931, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 19000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which century covers the period called \"Decay\"?", "information": "The decadence is, in part, a construction of the authors of the Renaixen\u00e7a and later critics", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "XVIII", "answer2": "XVI", "answer3": "They all are", "answer4": "XVII", "poi": {"id": 0, "name": "Barcelona", "visited_place": "Barcelona", "longitude": 2.173477, "latitude": 41.385973, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which of these dialects belong to Eastern dialects?", "information": "The eastern Catalan or eastern block of Catalan is the set of dialects of Catalan spoken in the east of the Principality (provinces of Girona and whole Barcelona and the vegueria of Tarragona), in Catalonia North, in the Balearic Islands and in Alghero.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Central", "answer2": "Balearic", "answer3": "They all are", "answer4": "Alghero", "poi": {"id": 0, "name": "Alg\u00e8ria", "visited_place": "Alg\u00e8ria", "longitude": 1.764673, "latitude": 28.203959, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 2500000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "When the Renaixen\u00e7a emerged", "information": "The Renaixen\u00e7a is the name given to the great restoration movement of Catalan language, literature and culture that began in the Principality in the first half of the nineteenth century and with which the contemporary period of Catalan literature opens.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Second half of the 19th century", "answer2": "Second half of the 18th century", "answer3": "First half of the 19th century", "answer4": "First half of the 18th century", "poi": {"id": 0, "name": "Barcelona", "visited_place": "Barcelona", "longitude": 2.173477, "latitude": 41.385973, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 22000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
