INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (79, '{"name": "Periodic Table", "category": "Science", "imageName": "games/game_79.png", "type": "MILLIONAIRE", "questions": [{"question": "Who discovered Polonium", "information": "Polonium is a chemical element with the symbol Po and atomic number 84. A rare and highly radioactive metal with no stable isotopes, polonium is chemically similar to selenium and tellurium, though its metallic character resembles that of its horizontal neighbors in the periodic table", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Albert Einstein", "answer2": "Robert Boyle", "answer3": "Marie Curie", "answer4": "Stephen Hawking", "poi": {"id": 0, "name": "Poland", "visited_place": "Poland", "longitude": 19.961608, "latitude": 50.040508, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1150000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What another element did Marie Curie discover", "information": "Radium is a chemical element with the symbol Ra and atomic number 88. It is the sixth element in group 2 of the periodic table, also known as the alkaline earth metals.All isotopes of radium are highly radioactive, with the most stable isotope being radium-226, which has a half-life of 1600 years and decays into radon gas", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Hydrogen", "answer2": "Helium", "answer3": "Iron", "answer4": "Radium", "poi": {"id": 0, "name": "Poland", "visited_place": "Poland", "longitude": 19.961608, "latitude": 50.040508, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1150000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who discovered Hydrogen", "information": "Hydrogen is the chemical element with the symbol H and atomic number 1. With a standard atomic weight of 1.008, hydrogen is the lightest element in the periodic table. Hydrogen is the most abundant chemical substance in the Universe, constituting roughly 75% of all baryonic mass.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Robert Boyle", "answer2": "Albert Einstein", "answer3": "Dimitri Mendeleiev", "answer4": "Niels Bohr", "poi": {"id": 0, "name": "Ireland", "visited_place": "Ireland", "longitude": -7.9308, "latitude": 52.1367, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 550000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Wich of these elements has a higher atomic mass", "information": "Cesium  is a chemical element with the symbol Cs and atomic number 55. It is a soft, silvery-golden alkali metal. It''s atomic mass is of 133u", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Cesium", "answer2": "Silver", "answer3": "Titanium", "answer4": "Potassium", "poi": {"id": 0, "name": "Germany", "visited_place": "Germany", "longitude": 9.935556, "latitude": 51.533889, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1150000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who discovered Uranium", "information": "Uranium is a chemical element with the symbol U and atomic number 92. It is a silvery-grey metal in the actinideseries of the periodic table. A uranium atom has 92 protons and 92 electrons, of which 6 are valence electrons.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Robert Boyle", "answer2": "Martin Heinrich Klaproth", "answer3": "William Gregor", "answer4": "Julius Klaproth", "poi": {"id": 0, "name": "Germany", "visited_place": "Germany", "longitude": 10.785278, "latitude": 51835.0, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1150000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Wich of these elements is a compound of sulfuric acid", "information": "Sulfuric acid also known as vitriol, is a mineral acid composed of the elements sulfur, oxygen and hydrogen, with molecular formula H2SO4. It is a colorless, odorless, and syrupy liquid that is soluble in water and is synthesized in reactions that are highly exothermic", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Sodium", "answer2": "Silicon", "answer3": "Potassium", "answer4": "Sulfur", "poi": {"id": 0, "name": "Russia", "visited_place": "Russia", "longitude": 87.711305, "latitude": 53.539805, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6800000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "How would you name this formula KClO3", "information": "Potassium chlorate is a compound containing potassium, chlorine and oxygen, with the molecular formula KClO3. In its pure form, it is a white crystalline substance. It is the most common chlorate in industrial use.It is used,", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Chloric acid", "answer2": "Chlorine Trioxide", "answer3": "Potassium chlorate", "answer4": "Chlor Potassate", "poi": {"id": 0, "name": "Russia", "visited_place": "Russia", "longitude": 87.711305, "latitude": 53.539805, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6800000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who created the periodic table", "information": "Dmitri Ivanovich Mendeleev was a Russian chemist and inventor. He formulated the Periodic Law, created a farsighted version of the periodic table of elements, and used it to correct the properties of some already discovered elements and also to predict the properties of eight elements yet to be discovered.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Albert Einstein", "answer2": "Dmitri Mendeleiev", "answer3": "Niels Bohr", "answer4": "Robert Boyle", "poi": {"id": 0, "name": "Russia", "visited_place": "Russia", "longitude": 87.711305, "latitude": 53.539805, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6800000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (80, '{"name": "Flags", "category": "Geography", "imageName": "games/game_78.jpg", "type": "MILLIONAIRE", "questions": [{"question": "%flag_mode% ic_flag_of_the_netherlands", "information": "The Netherlands is a country located mainly in Northwestern Europe. The European portion of the Netherlands consists of twelve separate provinces that border Germany to the east, Belgium to the south, and the North Sea to the northwest, with maritime borders in the North Sea with Belgium, Germany and the United Kingdom.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Netherlands", "answer2": "France", "answer3": "Italy", "answer4": "Spain", "poi": {"id": 0, "name": "Netherlands", "visited_place": "Netherlands", "longitude": 4.871838, "latitude": 52.37511, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_australia", "information": "Australia s a sovereign country comprising the mainland of the Australian continent, the island of Tasmania, and numerous smaller islands. It is the largest country in Oceania and the world''s sixth-largest country by total area. The neighbouring countries are Papua New Guinea, Indonesia, and East Timor to the north.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Australia", "answer2": "Scotland", "answer3": "England", "answer4": "Belgium", "poi": {"id": 0, "name": "Australia", "visited_place": "Australia", "longitude": 150.728849, "latitude": -33.747874, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_brazil", "information": "Brazil is the largest country in both South America and Latin America. At 8.5 million square kilometers  and with over 208 million people, Brazil is the world''s fifth-largest country by area and the fifth most populous. Its capital is Bras\u00edlia, and its most populated city is S\u00e3o Paulo.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Jamaica", "answer2": "Brazil", "answer3": "Mexico", "answer4": "Argentina", "poi": {"id": 0, "name": "Brazil", "visited_place": "Brazil", "longitude": -48.205492, "latitude": -24.482586, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_south_korea", "information": "South Korea is a country in East Asia, constituting the southern part of the Korean Peninsula and sharing a land border with North Korea. It''s capital, Seoul, is a major global city and half of South Korea''s over 51 million people live in the Seoul Capital Area, the fourth largest metropolitan economy in the world.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Thailand", "answer2": "Japan", "answer3": "South Korea", "answer4": "North Korea", "poi": {"id": 0, "name": "South Korea", "visited_place": "South Korea", "longitude": 128.058046, "latitude": 36.401832, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_finland", "information": "Finland is a Nordic country in Northern Europe bordering the Baltic Sea, Gulf of Bothnia, and Gulf of Finland, between Norway to the north, Sweden to the northwest, and Russia to the east. The capital and largest city is Helsinki.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Norway", "answer2": "Denmark", "answer3": "France", "answer4": "Finland", "poi": {"id": 0, "name": "Finland", "visited_place": "Finland", "longitude": 25.616274, "latitude": 63.391027, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_greece", "information": "Greece  is a country located in Southern and Southeast Europe, with a population of approximately 11 million as of 2016. Athens is the nation''s capital and largest city, followed by Thessaloniki", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Norway", "answer2": "Greece", "answer3": "Canada", "answer4": "Argentina", "poi": {"id": 0, "name": "Greece", "visited_place": "Greece", "longitude": 23.724949, "latitude": 37.989479, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_norway", "information": "Norway is a Nordic country in Northern Europe whose territory comprises the western and northernmost portion of the Scandinavian Peninsula  the remote island of Jan Mayen and the archipelago of Svalbard are also part of the Kingdom of Norway. The Antarctic Peter I Island and the sub-Antarctic Bouvet Island are dependent territories and thus not considered part of the kingdom. Norway also lays claim to a section of Antarctica known as Queen Maud Land.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Denmark", "answer2": "Switzerland", "answer3": "Greenland", "answer4": "Norway", "poi": {"id": 0, "name": "Norway", "visited_place": "Norway", "longitude": 10.492223, "latitude": 59.915377, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_greenland", "information": "Greenland is the world''s largest island.Three-quarters of Greenland is covered by the only permanent ice sheet outside Antarctica.It has a population of about 56,480 people.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Denmark", "answer2": "Poland", "answer3": "Greenland", "answer4": "Finland", "poi": {"id": 0, "name": "Greenland", "visited_place": "Greenland", "longitude": -43.582952, "latitude": 64.230889, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (81, '{"name": "Materials", "category": "Science", "imageName": "games/game_81.jpg", "type": "MILLIONAIRE", "questions": [{"question": "In wich of these objects steel is NOT used", "information": "Steel is an alloy of iron and carbon, and sometimes other elements. Because of its high tensile strength and low cost, it is a major component used in buildings, infrastructure, tools, ships, automobiles, machines, appliances, and weapons.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Furniture", "answer2": "Cars", "answer3": "Photovoltaic panels", "answer4": "Tools", "poi": {"id": 0, "name": "SPAIN(solar plant)", "visited_place": "SPAIN(solar plant)", "longitude": -6.277054, "latitude": 37.417863, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 36000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is the material used in electricity transport", "information": "Despite competition from other materials, copper remains the preferred electrical conductor in nearly all categories of electrical wiring except overhead electric power transmission where aluminium is often preferred.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Copper (Cu)", "answer2": "Iron (Fe) due to it''s great conductivity", "answer3": "Carbon (C)", "answer4": "Titanium (Ti)", "poi": {"id": 0, "name": "CHILE(world''s biggest copper mine)", "visited_place": "CHILE(world''s biggest copper mine)", "longitude": -68.901944, "latitude": -22.290556, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 22000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Wich of these is made out of Carbon", "information": "Graphene  is an allotrope of carbon in the form of a two-dimensional, atomic-scale, hexagonal lattice in which one atom forms each vertex.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Alpacca", "answer2": "Graphene", "answer3": "Orichalcum", "answer4": "Ruby", "poi": {"id": 0, "name": "USA(world''s biggest coal mine)", "visited_place": "USA(world''s biggest coal mine)", "longitude": -105.288333, "latitude": 43.558889, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 34000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is PVC", "information": "PVC is the world''s third-most widely produced synthetic plastic polymer,PVC comes in two basic forms: rigid (sometimes abbreviated as RPVC) and flexible.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "A plastic polymer", "answer2": "A gas", "answer3": "A Polycyclohexanol", "answer4": "A metal", "poi": {"id": 0, "name": "GERMANY", "visited_place": "GERMANY", "longitude": 10.120094, "latitude": 50.712689, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1150000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is the material with best conductivity", "information": "The most electrically conductive element is silver, followed by copper and gold. Silver also has the highest thermal conductivity of any element and the highest light reflectance.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Gold (Au)", "answer2": "Copper(Cu)", "answer3": "Aluminium (Al)", "answer4": "Silver (Ag)", "poi": {"id": 0, "name": "AUSTRALIA(world''s biggest silver mine)", "visited_place": "AUSTRALIA(world''s biggest silver mine)", "longitude": 140.91611111111, "latitude": -21.8625, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 8000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What is an element fusion point", "information": "The fusion point isthe temperature that the material changes from solid to liquid.Carnelley''s rule, established in 1882 by Thomas Carnelley, states that high molecular symmetry is associated with high melting point. Carnelley based his rule on examination of 15,000 chemical compounds.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "The temperature that the material changes from liquid to gas", "answer2": "The temperature that the material changes from solid to liquid", "answer3": "The temperature that the material changes from solid to gas", "answer4": "The temperature that the material changes from liquid to plasma", "poi": {"id": 0, "name": "London", "visited_place": "London", "longitude": -0.118092, "latitude": 51.509865, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 38000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Wich one of these is the softest material", "information": "Talc is a clay mineral composed of hydrated magnesium silicate with the chemical formula Mg3Si4O10(OH)2. Talc in powdered form, often in combination with corn starch, is widely used as baby powder.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Sand", "answer2": "Diamond", "answer3": "Talc", "answer4": "Wood", "poi": {"id": 0, "name": "AUSTRALIA(talc mine)", "visited_place": "AUSTRALIA(talc mine)", "longitude": 139.58336, "latitude": -29.959659, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 38000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Wich of these is tougher", "information": "One-atom-thick sheets of carbon are 200 times stronger than steel. It would take an elephant balancing on a pencil to break a sheet as thin as Saran wrap.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Steel", "answer2": "Titanium", "answer3": "Diamond", "answer4": "Graphene", "poi": {"id": 0, "name": "USA(world''s biggest coal mine)", "visited_place": "USA(world''s biggest coal mine)", "longitude": -105.288333, "latitude": 43.558889, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 34000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (82, '{"name": "Flags3", "category": "Geography", "imageName": "games/game_78.jpg", "type": "MILLIONAIRE", "questions": [{"question": "%flag_mode% ic_flag_of_austria", "information": "Austria is a country in Central Europe comprising nine federated states. Its capital, largest city and one of nine states is Vienna. Austria has an area of 83,879 km2 , a population of nearly nine million people", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Sweden", "answer2": "Denmark", "answer3": "Austria", "answer4": "Romania", "poi": {"id": 0, "name": "Austria", "visited_place": "Austria", "longitude": 16.310689, "latitude": 48.116587, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_algeria", "information": "Algeria is a country in the Maghreb region of North Africa. The capital and most populous city is Algiers, located in the far north of the country on the Mediterranean coast. With an area of 2,381,741 square kilometres , Algeria is the tenth-largest country in the world, the world''s largest Arab country, and the largest in Africa.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Turkey", "answer2": "Algeria", "answer3": "Egypt", "answer4": "Jamaica", "poi": {"id": 0, "name": "Algeria", "visited_place": "Algeria", "longitude": 3.376181, "latitude": 36.703709, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_iceland", "information": "Iceland is a Nordic island country in the North Atlantic, with a population of 358,780 and an area of 103,000 km2 , making it the densely populated country in Europe", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Greendland", "answer2": "Sweden", "answer3": "Norway", "answer4": "Iceland", "poi": {"id": 0, "name": "Iceland", "visited_place": "Iceland", "longitude": -18.586984, "latitude": 64.495673, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_poland", "information": "Poland is a country located in Central Europe.It is divided into 16 administrative subdivisions, covering an area of 312,696 square kilometres , and has a largely temperate seasonal climate. With a population of approximately 38.5 million people, Poland is the sixth most populous member state of the European Union.Poland''s capital and largest metropolis is Warsaw.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Poland", "answer2": "Belgium", "answer3": "Netherlands", "answer4": "Colombia", "poi": {"id": 0, "name": "Poland", "visited_place": "Poland", "longitude": 20.164539, "latitude": 50.027604, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_india", "information": "India is a country in South Asia. It is the seventh-largest country by area, the second-most populous country, and the most populous democracy in the world.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "India", "answer2": "Niger", "answer3": "Thailand", "answer4": "Jamaica", "poi": {"id": 0, "name": "India", "visited_place": "India", "longitude": 78.065906, "latitude": 9.449219, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_north_korea", "information": "North Korea is a country in East Asia constituting the northern part of the Korean Peninsula, with Pyongyang being the capital and the largest city in the country. To the north and northwest, the country is bordered by China and by Russia along the Amnok and Tumen rivers and to the south it is bordered by South Korea, with the heavily fortified Korean Demilitarized Zone (DMZ) separating the two.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "South Korea", "answer2": "North Korea", "answer3": "Japan", "answer4": "Chile", "poi": {"id": 0, "name": "North Korea", "visited_place": "North Korea", "longitude": 125.719417, "latitude": 38.975689, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_thailand", "information": "Thailand is a country at the centre of the Southeast Asian Indochinese peninsula composed of 76 provinces. At 513,120 km2 and over 68 million people, Thailand is the world''s 50th largest country by total area and the 21st-most-populous country", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Netherlands", "answer2": "France", "answer3": "China", "answer4": "Thailand", "poi": {"id": 0, "name": "Thailand", "visited_place": "Thailand", "longitude": 100.530585, "latitude": 13.739201, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_turkey", "information": "Turkey  is a transcontinental country located mainly in Western Asia, with a smaller portion on the Balkan Peninsula in Southeast Europe. East Thrace, located in Europe, is separated from Anatolia by the Sea of Marmara, the Bosphorous strait and the Dardanelle", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "India", "answer2": "Vietnam", "answer3": "Turkey", "answer4": "Egypt", "poi": {"id": 0, "name": "Turkey", "visited_place": "Turkey", "longitude": 28.91733, "latitude": 41.088869, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (83, '{"name": "Science2", "category": "Science", "imageName": "games/game_69.jpg", "type": "MILLIONAIRE", "questions": [{"question": "Who discovered de pinicilin", "information": "Alexander Fleming discovers penicillin, then Howard Florey and Chain Boris isolated and purified the compound, producing the first antibiotic. Fleming''s discovery comes completely by accident when he realizes that the mold has killed a sample of bacteria in a petri dish that languishes under a sink in his laboratory sink. Fleming isolates a sample from the mold and identifies it as Penicillium notatum.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Charles Darwin", "answer2": "Alexander Fleming", "answer3": "Galileo Galilei", "answer4": "Archimedes", "poi": {"id": 0, "name": "Darvel", "visited_place": "Darvel", "longitude": -4.286314, "latitude": 55.609868, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 2000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Wich of this laws off Isaac Newton is correct", "information": "Isaac Newton changes our understanding of the universe by formulating three laws that describe the movement of objects. 1) An object in motion remains in motion unless an external force is applied to it. 2) The relation between the mass of an object (m), its acceleration (a) and the applied force (F) is F = ma. 3) For each action there is an equal and opposite reaction.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "An object with movement allways it''s in movement", "answer2": "There is not any reaction for any action", "answer3": "The relation between the mass of an object (m), its acceleration (a) and the applied force (F) is F = ma", "answer4": "Any law is correct", "poi": {"id": 0, "name": "Woolsthorpe", "visited_place": "Woolsthorpe", "longitude": -0.631897, "latitude": 52.810426, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who discovered the law of falling bodies", "information": "Galileo Galilei overturns nearly 2,000 years of Aristotelian belief that heavier bodies fall faster than light bodies, proving that all bodies fall at the same speed", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Galileo Galilei", "answer2": "Isaac Newton", "answer3": "Albert Einstein", "answer4": "Stephen Hawking", "poi": {"id": 0, "name": "Pisa", "visited_place": "Pisa", "longitude": 10.401039, "latitude": 43.722789, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 10000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who considered the atomic theory", "information": "John Dalton proporciona una manera de vincular los \u00e1tomos invisibles a las cantidades mensurables, tales como el volumen de un gas o la masa de un mineral. Su teor\u00eda establece que los elementos at\u00f3micos consisten en peque\u00f1as part\u00edculas llamadas \u00e1tomos. Por lo tanto, un elemento puro se compone de \u00e1tomos id\u00e9nticos, todos con la misma masa, y los compuestos formados por \u00e1tomos de diferentes elementos se combinan juntos.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "JJ Thomson", "answer2": "Niels Bohr", "answer3": "Ernest Rutherford", "answer4": "John Dalton", "poi": {"id": 0, "name": "Eaglesfield", "visited_place": "Eaglesfield", "longitude": -3.193259, "latitude": 55.060555, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Wich of this biologists described with James Watson the ADN with a double helix", "information": "James Watson and Francis Crick describe the DNA molecule. Scientists suggest that the DNA molecule is made up of two chains of nucleotides, each in a helix, one going up and the other down. Crick adds the idea that the adequacy of the interlocking base pairs in the middle of the double helix to keep the distance between the chains constant. They show that each strand of the DNA molecule is a template for the other, and that the DNA can be reproduced without changing its structure, except for occasional errors or mutations.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Francis Crick", "answer2": "Charles Darwin", "answer3": "Gregor Mendel", "answer4": "Alexander Fleming", "poi": {"id": 0, "name": "Weston Favell", "visited_place": "Weston Favell", "longitude": -0.85152, "latitude": 52.250881, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "What did Robert Brown identify in the middle of an animal cell", "information": "While studying an orchid, the botanist Robert Brown identifies a structure in the cells that he calls the \"nucleus\".", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Mitochondria", "answer2": "Golgi device", "answer3": "Nucleus", "answer4": "Endoplasmic reticulum", "poi": {"id": 0, "name": "Montrose", "visited_place": "Montrose", "longitude": -2.465953, "latitude": 56.706991, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 8000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who discovered the law of gravity", "information": "All objects attract each other with a force directly proportional to the product of their masses and inversely proportional to the square of the distance separating their centers", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Albert Einstein", "answer2": "Isaac Newton", "answer3": "Archimedes", "answer4": "Marie Curie", "poi": {"id": 0, "name": "Woolsthorpe", "visited_place": "Woolsthorpe", "longitude": -0.631897, "latitude": 52.810426, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who defined the properties of the radioactivitie", "information": "The discovery of radium and polonium allowed defining the properties of radioactivity, a term coined by the researcher", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt":