INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (84, '{"name": "Geometry", "category": "Technology", "imageName": "games/game_84.png", "type": "MILLIONAIRE", "questions": [{"question": "Who invented a famous theorem, which lets you divide segments", "information": "Thales''s theorem says that if we have three parallel straight lines, a, b and c, and they cut other two ones, r and r\u2019, then they produce proportional segments", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Thales", "answer2": "Pythagoras", "answer3": "Archimedes", "answer4": "Einstein", "poi": {"id": 0, "name": "Miletus", "visited_place": "Miletus", "longitude": 27.276043, "latitude": 37.530463, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Who discovered a theorem, which lets you calculate the third side of a right-angle triangle, knowing the two others", "information": "In mathematics, the Pythagorean theorem, also known as Pythagoras'' theorem, is a fundamental relation in Euclidean geometry among the three sides of a right triangle. It states that the square of the hypotenuse (the side opposite the right angle) is equal to the sum of the squares of the other two sides.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Einstein", "answer2": "Archimedes", "answer3": "Pythagoras", "answer4": "Thales", "poi": {"id": 0, "name": "Samos", "visited_place": "Samos", "longitude": 26.976642, "latitude": 37.756566, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "Which geometrical shape has not any angle on it?", "information": "A circle which is a shape of geometry has no straight lines. It is rather a combination of curves that are all connected. In a circle, there are no angles to be found.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Square", "answer2": "Triangle", "answer3": "Rectangle", "answer4": "Circle", "poi": {"id": 0, "name": "London", "visited_place": "London", "longitude": -0.12839, "latitude": 51.505885, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 200000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "How many sides does a hexagon have?", "information": "An hexagon is a six-sided polygon or 6-gon. The total of the internal angles of any simple (non-self-intersecting) hexagon is 720\u00b0.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "3", "answer2": "6", "answer3": "7", "answer4": "5", "poi": {"id": 0, "name": "Brussels", "visited_place": "Brussels", "longitude": 4.359246, "latitude": 50.844977, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 25000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "The internal angles of an equilateral triangle all measure how many degrees?", "information": "In geometry, an equilateral triangle is a triangle in which all three sides are equal. In the familiar Euclidean geometry, an equilateral triangle is also equiangular; that is, all three internal angles are also congruent to each other and are each 60\u00b0. It is also a regular polygon, so it is also referred to as a regular triangle.", "correct_answer": 4, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "120", "answer2": "90", "answer3": "360", "answer4": "180", "poi": {"id": 0, "name": "Ohio", "visited_place": "Ohio", "longitude": -82.601672, "latitude": 41.2935, "altitude": 0.0, "heading": 0.0, "tilt": 45.0, "range": 3000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "How many points are there on a pentagram?", "information": "A pentagram (sometimes known as a pentalpha, pentangle or star pentagon) is the shape of a five-pointed star.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "2", "answer2": "3", "answer3": "5", "answer4": "7", "poi": {"id": 0, "name": "NORTH_AMERICA", "visited_place": "NORTH_AMERICA", "longitude": -100.90688, "latitude": 40.478544, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 8000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "The distance from the center of a circle to its edge is called what?", "information": "The radius of a circle is the distance from the center of the circle to any point on its circumference. The easiest way to find the radius is by dividing the diameter in half.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Radius", "answer2": "Diameter", "answer3": "Side", "answer4": "Vertex", "poi": {"id": 0, "name": "Miletus", "visited_place": "Miletus", "longitude": 27.276043, "latitude": 37.530463, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 6000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "How many sides of equal length does a square have?", "information": "In geometry, a square is a regular quadrilateral, which means that it has four equal sides and four equal angles (90-degree angles, or (100-gradian angles or right angles). It can also be defined as a rectangle in which two adjacent sides have equal length.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Europe", "visited_place": "Europe", "longitude": 10.52668, "latitude": 40.085941, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 7000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "3", "answer2": "4", "answer3": "2", "answer4": "6", "poi": {"id": 0, "name": "Samos", "visited_place": "Samos", "longitude": 26.976642, "latitude": 37.756566, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 3000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "How many dimensions does a semicircle feature?", "information": "", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "4", "answer2": "5", "answer3": "2", "answer4": "3", "poi": {"id": 0, "name": "Athens", "visited_place": "Athens", "longitude": 23.722808, "latitude": 37.986644, "altitude": 0.0, "heading": 0.0, "tilt"