INSERT INTO `game` (_id,Data,google_drive_file_id) VALUES (86, '{"name": "Flags2", "category": "Geography", "imageName": "games/game_78.jpg", "type": "MILLIONAIRE", "questions": [{"question": "%flag_mode% ic_flag_of_the_united_kingdom", "information": "The United Kingdom is a sovereign country located off the north-western coast of the European mainland. The United Kingdom includes the island of Great Britain, the north-eastern part of the island of Ireland, and many smaller islands.[16] Northern Ireland is the only part of the United Kingdom that shares a land border with another sovereign state, the Republic of Ireland. Apart from this land border, the United Kingdom is surrounded by the Atlantic Ocean, with the North Sea to the east, the English Channel to the south and the Celtic Sea to the south-west, giving it the 12th-longest coastline in the world.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "UK", "answer2": "USA", "answer3": "Australia", "answer4": "Belgium", "poi": {"id": 0, "name": "UK", "visited_place": "UK", "longitude": -0.123663, "latitude": 51.500863, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_the_vatican_city", "information": "The Vatican city is an independent city-state enclaved within Rome, Italy. Established with the Lateran Treaty (1929), it is distinct from yet under \"full ownership, exclusive dominion, and sovereign authority and jurisdiction\" of the Holy See. With an area of 44 hectares , and a population of about 1,000, it is the smallest sovereign state in the world by both area and population.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Andorra", "answer2": "Vatican country", "answer3": "Vatican city", "answer4": "Italy", "poi": {"id": 0, "name": "Vatican City", "visited_place": "Vatican City", "longitude": 12.455301, "latitude": 41.904136, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_switzerland", "information": "Switzerland is a sovereign state situated in the confluence of western, central, and southern Europe. It is a federal republic composed of 26 cantons, with federal authorities seated in Bern.Switzerland is a landlocked country bordered by Italy to the south, France to the west, Germany to the north, and Austria and Liechtenstein to the east.", "correct_answer": 2, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Denmark", "answer2": "Switzerland", "answer3": "Sweden", "answer4": "Norway", "poi": {"id": 0, "name": "Switzerland", "visited_place": "Switzerland", "longitude": 8.552371, "latitude": 47.300341, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_denmark", "information": "Denmark  is a sovereign state in Northern Europe. Denmark proper consists of a peninsula, Jutland, and an archipelago of 443 named islands, with the largest being Zealand, Funen and the North Jutlandic Island. The islands are characterised by flat, arable land and sandy coasts, low elevation and a temperate climate.", "correct_answer":