kmen, Shabakis, Yazidis, Armenians, Mandeans, Circassians and Kawliya.", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Egypt", "answer2": "Siria", "answer3": "Iraq", "answer4": "Spain", "poi": {"id": 0, "name": "Iraq", "visited_place": "Iraq", "longitude": 44.041142, "latitude": 32.624168, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_peru", "information": "Peru is a country in western South America. It is bordered in the north by Ecuador and Colombia, in the east by Brazil, in the southeast by Bolivia, in the south by Chile, and in the west by the Pacific Ocean. Peru is a megadiverse country with habitats ranging from the arid plains of the Pacific coastal region in the west to the peaks of the Andes mountains vertically extending from the north to the southeast of the country to the tropical Amazon Basin rainforest in the east with the Amazon river", "correct_answer": 3, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Egypt", "answer2": "Sweden", "answer3": "Peru", "answer4": "Colombia", "poi": {"id": 0, "name": "Peru", "visited_place": "Peru", "longitude": -77.03729, "latitude": -12.065093, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}, {"question": "%flag_mode% ic_flag_of_namibia", "information": "Namibia is a country in southern Africa. Its western border is the Atlantic Ocean; it shares land borders with Zambia and Angola to the north, Botswana to the east and South Africa to the south and east.", "correct_answer": 1, "initial_poi": {"id": 0, "name": "Earth", "visited_place": "Earth", "longitude": -5.57958, "latitude": -8.677025, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 15000000.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}, "answer1": "Namibia", "answer2": "Niger", "answer3": "Iraq", "answer4": "Colombia", "poi": {"id": 0, "name": "Namibia", "visited_place": "Namibia", "longitude": 17.256215, "latitude": -23.549879, "altitude": 0.0, "heading": 0.0, "tilt": 0.0, "range": 1000001.0, "altitudeMode": "relativeToSeaFloor", "hidden": false, "categoryId": 1}}]}','');
